// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract NftMarket is ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;

    struct NftItem {
        uint256 tokenId;
        uint256 price;
        address creator;
        bool isListed;
    }

    uint256 public listingPrice = 0.025 ether;

    Counters.Counter private _listItems;
    Counters.Counter private _tokenIds;

    uint256[] private _allNfts;
    mapping(uint256 => uint256) private _idToNftIndex;

    mapping(string => bool) private _usedTokenURIs;
    mapping(uint256 => NftItem) private _idToNftItem;

    mapping(address => mapping(uint256 => uint256)) private _ownedToken;
    mapping(uint256 => uint256) private _idToOwnedIndex;

    event NftItemCreated(
        uint256 tokenId,
        uint256 price,
        address creator,
        bool isListed
    );

    constructor() ERC721("CreaturesNFT", "CNFT") {}

    function setListingPrice(uint256 price) external onlyOwner {
        require(price > 0, "Price must be at lease 1 wei");

        listingPrice = price;
    }

    function getNftItem(uint256 tokenId) public view returns (NftItem memory) {
        return _idToNftItem[tokenId];
    }

    function listedItemsCount() public view returns (uint256) {
        return _listItems.current();
    }

    function tokenURIExists(string memory tokenURI) public view returns (bool) {
        return _usedTokenURIs[tokenURI];
    }

    function totalSupply() public view returns (uint256) {
        return _allNfts.length;
    }

    function tokenByIndex(uint256 index) public view returns (uint256) {
        require(index < totalSupply(), "Index out of bound");
        return _allNfts[index];
    }

    function tokenOfOwnerByIndex(address owner, uint256 index)
        public
        view
        returns (uint256)
    {
        require(index < balanceOf(owner), "Index out of bound");
        return _ownedToken[owner][index];
    }

    function getAllNftsOnSale() public view returns (NftItem[] memory) {
        uint256 allItemCounts = totalSupply();
        uint256 currentIndex = 0;
        NftItem[] memory items = new NftItem[](_listItems.current());

        for (uint256 index = 0; index < allItemCounts; ++index) {
            uint256 tokenId = tokenByIndex(index);
            NftItem storage nftItem = _idToNftItem[tokenId];

            if (nftItem.isListed) {
                items[currentIndex] = nftItem;
                ++currentIndex;
            }
        }

        return items;
    }

    function getOwnedNfts() public view returns (NftItem[] memory) {
        uint256 ownedItemCounts = balanceOf(msg.sender);
        NftItem[] memory items = new NftItem[](ownedItemCounts);

        for (uint256 index = 0; index < ownedItemCounts; ++index) {
            uint256 tokenId = tokenOfOwnerByIndex(msg.sender, index);
            NftItem memory nftItem = _idToNftItem[tokenId];
            items[index] = nftItem;
        }

        return items;
    }

    function mintToken(string memory tokenURI, uint256 price)
        public
        payable
        returns (uint256)
    {
        require(!tokenURIExists(tokenURI), "Token URI already exists");
        require(
            msg.value == listingPrice,
            "Price must be equal to listing price"
        );
        _listItems.increment();
        _tokenIds.increment();

        uint256 newTokenId = _tokenIds.current();
        _safeMint(msg.sender, newTokenId);
        _setTokenURI(newTokenId, tokenURI);
        _createNftItem(newTokenId, price);
        _usedTokenURIs[tokenURI] = true;

        return newTokenId;
    }

    function buyNft(uint256 tokenId) public payable {
        uint256 price = _idToNftItem[tokenId].price;
        address owner = ownerOf(tokenId);

        require(msg.sender != owner, "You already own this NFT");
        require(msg.value == price, "Please submit the asking value");

        _idToNftItem[tokenId].isListed = false;
        _listItems.decrement();

        _transfer(owner, msg.sender, tokenId);
        payable(owner).transfer(msg.value);
    }

    function placeNftOnSale(uint256 tokenId, uint256 price) public payable {
        require(ownerOf(tokenId) == msg.sender, "You haven't owned this nft");
        require(
            !_idToNftItem[tokenId].isListed,
            "This item have already listed"
        );
        require(msg.value == listingPrice, "Price must be equal listing price");

        _idToNftItem[tokenId].isListed = true;
        _idToNftItem[tokenId].price = price;
        _listItems.increment();
    }

    function _createNftItem(uint256 tokenId, uint256 price) private {
        require(price > 0, "Price must be at lease 1 wei");

        _idToNftItem[tokenId] = NftItem(tokenId, price, msg.sender, true);

        emit NftItemCreated(tokenId, price, msg.sender, true);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal virtual override {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);

        if (from == address(0)) {
            _addTokenToAllTokensEnumeration(tokenId);
        } else if (from != to) {
            _removeTokenFromOwnerTokensEnumeration(from, tokenId);
        }

        if (to == address(0)) {
            _removeTokenFromAllTokensEnumeration(tokenId);
        } else if (from != to) {
            _addTokenToOwnerTokensEnumeration(to, tokenId);
        }
    }

    function _addTokenToAllTokensEnumeration(uint256 tokenId) private {
        _idToNftIndex[tokenId] = _allNfts.length;
        _allNfts.push(tokenId);
    }

    function _addTokenToOwnerTokensEnumeration(address to, uint256 tokenId)
        private
    {
        uint256 length = balanceOf(to);
        _ownedToken[to][length] = tokenId;
        _idToOwnedIndex[tokenId] = length;
    }

    function _removeTokenFromOwnerTokensEnumeration(
        address from,
        uint256 tokenId
    ) private {
        uint256 lastTokenIndex = balanceOf(from) - 1;
        uint256 tokenIndex = _idToOwnedIndex[tokenId];

        if (tokenIndex != lastTokenIndex) {
            uint256 lastTokenId = _ownedToken[from][lastTokenIndex];

            _ownedToken[from][tokenIndex] = lastTokenId;
            _idToOwnedIndex[lastTokenId] = tokenIndex;
        }

        delete _idToOwnedIndex[tokenId];
        delete _ownedToken[from][lastTokenIndex];
    }

    function _removeTokenFromAllTokensEnumeration(uint256 tokenId) private {
        uint256 lastTokenIndex = _allNfts.length - 1;
        uint256 lastTokenId = _allNfts[lastTokenIndex];
        uint256 tokenIndex = _idToNftIndex[tokenId];

        if (lastTokenId != tokenId) {
            _allNfts[tokenIndex] = lastTokenId;
            _idToNftIndex[lastTokenId] = tokenIndex;
        }

        delete _idToNftIndex[tokenId];
        _allNfts.pop();
    }
}
